import PhotoCardsView from './PhotoCards-view'
import React from 'react'


const PhotoCards = ({ photos, owner }) => {
    return <div className="columns is-gapless is-multiline is-mobile">
        {photos.map(photo => {
            return <PhotoCardsView {...photo} owner={owner} />
        })}
    </div>

}



export default PhotoCards
